description:
The package contains the loco BR143 in eight different versions with liveries used by the former Deutsche Reichsbahn. The colours are wine-red and red. Four locos use the number which is used for the Colour-Loco combination, four locos use dynamic numbering. The cab is changed to the version used by former DR.



